import React from 'react';
import Lottie from 'lottie-react';
import strategyAnimation from '../lottie/strategy_animation.json';
import designAnimation from '../lottie/design_animation.json';
import developmentAnimation from '../lottie/development_animation.json';

const Impressum = () => {
    return (
        <section className="max-w-7xl mx-auto p-4 flex items-center justify-center text-left my-16">
            <div className='flex flex-row w-full justify-between'>
                <div className='w-1/3 flex justify-center items-center flex-col border-r border-white/10'>
                    <div className='flex flex-col gap-16'>
                        <Lottie
                            animationData={strategyAnimation}
                            loop={true}
                            autoplay={true}
                            style={{ height: 200, width: 200 }}
                        />
                        <span className='uppercase text-base leading-6'>1 Strategy</span>
                    </div>
                </div>
                <div className='w-1/3 flex justify-center items-center flex-col border-r border-white/10'>
                    <div className='flex flex-col gap-16'>
                        <Lottie
                            animationData={designAnimation}
                            loop={true}
                            autoplay={true}
                            style={{ height: 200, width: 200 }}
                        />
                        <span className='uppercase text-base leading-6'>2 Design</span>
                    </div>
                </div>
                <div className='w-1/3 flex justify-center items-center'>
                    <div className='flex flex-col gap-16'>
                        <Lottie
                            animationData={developmentAnimation}
                            loop={true}
                            autoplay={true}
                            style={{ height: 200, width: 200 }}
                        />
                        <div className='flex flex-col gap-6'>
                            <span className='uppercase text-base leading-6'>3 Development</span>
                            <ul>
                                <li>Creative Lead</li>
                                <li>Research</li>
                                <li>Competetitor Analysis</li>
                                <li>User Journeys/Flows</li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Impressum;
